import {Image} from "react-bootstrap";

const RightSide = () => {
    return (
        <div style={{width:"80%", marginLeft:"10%", marginTop:"10%"}}>
           <Image src="https://haelaw.com/wp-content/uploads/2021/07/Screenshot_210.png" thumbnail style={{border:"none"}} /> 
        </div>
    )
}

export default RightSide;
